import React, { Component } from "react";
import ReactTypingEffect from "react-typing-effect";

const typingEffect = () => {
  return (
    <div>
      <ReactTypingEffect text="ignoring the meteorites that are beginning to fall" />
    </div>
  );
};

export default class IntroText2 extends Component {
  render() {
    if (!this.props.render) {
      return null;
    } else {
      return (
        <div className="intro">
          <div className="textIntro">{typingEffect()}</div>
        </div>
      );
    }
  }
}
